const Contact = () => {
  return (
    <div className='Container'>
        <div className='row'>
            <div className='col-md-12'>
              <div className='found'>
              <div class="input-group mb-3">
  <input type="text" classNamme="form-control" placeholder="Recipient's username" aria-label=" username" />
 
</div>
              </div>
            </div>

        </div>
    </div>
  )
}

export default Contact
